import * as React from 'react';
import { AppProvider } from '@toolpad/core/AppProvider';
import { SignInPage } from '@toolpad/core/SignInPage';
import { useTheme } from '@mui/material/styles';

// preview-start
const providers = [{ id: 'credentials', name: 'Email and Password' }];
// preview-end

const signIn = async (provider, formData) => {
  const promise = new Promise((resolve) => {
    setTimeout(() => {
      alert(
        `Signing in with "${provider.name}" and credentials: ${formData.get('email')}, ${formData.get('password')}`,
      );
      resolve();
    }, 300);
  });
  return promise;
};

const DrawerList = (
  <Box sx={{ width: 250 }} role="presentation">
    {/* ... première liste reste inchangée ... */}
    <Divider />
    <List>
      {[
        { text: 'Créer votre recette', path: '/CreerRecette' },
        { text: 'Modifier votre recette', path: '/ModifierRecette' },
        { text: 'Supprimer votre recette', path: '/SupprimeRecette' },
        { text: 'Partager votre recette', path: '/PartagerRecette' },
      ].map((item, index) => (
        <ListItem key={item.text} disablePadding>
          <ListItemButton onClick={() => handleNavigation(item.path)}>
            <ListItemIcon>
              {index % 2 === 0 ? <InboxIcon /> : <MailIcon />}
            </ListItemIcon>
            <ListItemText primary={item.text} />
          </ListItemButton>
        </ListItem>
      ))}
    </List>
  </Box>
);









export default function CredentialsSignInPage() {
  const theme = useTheme();
  return (
    // preview-start
    <AppProvider theme={theme}>
      <SignInPage
        signIn={signIn}
        providers={providers}
        slotProps={{ emailField: { autoFocus: false } }}
      />
    </AppProvider>
    // preview-end
  );
}
